var PrintPlugin = (function() {
	PRINT_BROWSER = {
		SAFARI: 'safari',
		IE: 'ie',
		EDGE: 'edge',
		CHROME: 'chrome',
	}
	
	var pdfDoc = null,
	    scale = 1,
		numOfLoadedPages = 0,
	    isPageSizeStyleAdded = false;
	
	var PRINT_RESOLUTION = 150;
	var CSS_UNITS = 96.0 / 72.0;
	var PRINT_UNITS = PRINT_RESOLUTION / 72.0;
	
	var getDataUriFromCanvas = function (canvas) {
		return new Promise(function (resolve, reject) {
			if (('toBlob' in canvas)) {
			  canvas.toBlob(function(blob) {
				  resolve(URL.createObjectURL(blob));
			  });
			} else {
				resolve(canvas.toDataURL());
			}
		})
	};
	
	function setPageSizeMediaQuery(width, height) {
		if (isPageSizeStyleAdded) {
			return;
		} else {
			var pdfStyleDiv = document.getElementById('pdfStyle');
			if (pdfStyleDiv) {
				pdfStyleDiv.parentNode.removeChild(pdfStyleDiv);	
			}
		}
		
		var body = document.querySelector('body');
	    // Insert a @page + size rule to make sure that the page size is correctly
	    // set. Note that we assume that all pages have the same size
	    var pageStyleSheet = document.createElement('style');
		pageStyleSheet.id = 'pdfStyle';
	    pageStyleSheet.textContent =
	      // "size:<width> <height>" is what we need. But also add "A4" because
	      // Firefox incorrectly reports support for the other value.
	      '@supports ((size:A4) and (size:1pt 1pt)) {' +
	      '@page { size: ' + width + 'pt ' + height + 'pt ;}' +
	      '}';
	    body.appendChild(pageStyleSheet);
		isPageSizeStyleAdded = true;
	}
	
	/**
	 * Asynchronously renders page into an image div from the pdf document.
	 */
	function renderPage(pdfDoc, num, img, wrapperElem, browser, callback) {
	  var tempCanvas = document.createElement('canvas');
	  var ctx = tempCanvas.getContext('2d');
	
	  // Using promise to fetch the page
	  pdfDoc.getPage(num).then(function(page) {
	    var viewport = page.getViewport(scale);
	
	    tempCanvas.width = Math.floor(viewport.width * PRINT_UNITS);
	    tempCanvas.height = Math.floor(viewport.height * PRINT_UNITS);
	    
	    // The physical size of the img as specified by the PDF document.
	    var width = Math.floor(viewport.width * CSS_UNITS) + 'px';
	    var height = Math.floor(viewport.height * CSS_UNITS) + 'px';
		if (browser === PRINT_BROWSER.IE || browser === PRINT_BROWSER.EDGE) {
			img.style.width = width;
		} else {
	        //img.style.height = height;   
	    }
		
		setPageSizeMediaQuery(viewport.width, viewport.height);
		
	    ctx.save();
	    ctx.fillStyle = 'rgb(255, 255, 255)';
	    ctx.fillRect(0, 0, tempCanvas.width, tempCanvas.height);
	    ctx.restore();
	
	    // Render PDF page into canvas context
	    var renderContext = {
	      canvasContext: ctx,
	      transform: [PRINT_UNITS, 0, 0, PRINT_UNITS, 0, 0],
	      viewport: viewport,
	      intent: 'print',
	    };
	
	    var renderTask = page.render(renderContext);
	    renderTask.then(function(){
	    	getDataUriFromCanvas(tempCanvas)
	    	.then(function(uri) {
			    img.onload = function () {
				    numOfLoadedPages++;
				    if (numOfLoadedPages === pdfDoc.numPages) {
				    	callback(wrapperElem);
				    }
			    };
			    img.src = uri;
	    	});
	    });
	  });
	}
	
	/**
	 * Asynchronously downloads PDF and initiates the rendering of pdf into images.
	 * @param url URL from which the pdf needs to be fetched
	 * @param wrapperElem id name/string of the element in which images will be appended
	 * @param browser Any valid value from PRINT_BROWSER
	 * @param onFinishCallback - will be called when the images have been rendered and loaded.
	 */
	var printPDF = function(url, wrapperElem, browser, onFinishCallback) {
		
		var pdfData = atob('');
		
		var printDiv = document.getElementById(wrapperElem);
		numOfLoadedPages = 0;
		isPageSizeStyleAdded = false;
		
		PDFJS.getDocument( {data: pdfData} ).then(function(pdfDoc_) {
			
		  pdfDoc = pdfDoc_;  
		  for(var i = 0; i < pdfDoc.numPages; i++) 
		  {	  
			  var tempImg = document.createElement('img');
			  renderPage(pdfDoc, i+1, tempImg, wrapperElem, browser, onFinishCallback);
			  printDiv.appendChild(tempImg);
		  }
		  
		});
	};
	
	// PrintPlugin only exposes the following to the outside world:
	return {
		PRINT_BROWSER: PRINT_BROWSER,
		printPDF: printPDF,
	};
	
}());